window.bookSummaryJSON = "<p><b>Prince Jeffrey is a bossy, smug, overprotective grouch and the last man I want anywhere near my V-card. </b></p> <p>Would I like to know what all the sexy times fuss is about? Heck yes.</p> <p>Do I want to lose my virginity to a prince out to ruin my plans? Or risk breaking the heart of a man I'll have to leave behind? Hell. No. </p> <p>I'm already living on borrowed time. If the firstborn curse on my family is real, I only have six months to ensure my twin sister lives happily ever after. But Jeffrey wants to slam the brakes on my sister's romance with his brother and force me to stay in bed until I recover from a touch of pneumonia.</p> <p>But I don't have time to stay in bed! And I certainly don't have time to fall madly in love with this man who holds me like I'm something precious, kisses me until my bones melt, and promises to protect me at all costs.</p> <p>But he can't protect me from Fate. Can he?</p> <p>Or is Jeffrey Von Bergen keeping secrets too? </p> <p>Secrets that might change...everything.</p>"; 
